member.summary:
Gets or sets true if the retention policy should always keep at
least one backup in the storage account, regardless how old it is;
false otherwise.

member.param:
ARM resource ID of the source app. App
            resource ID is of the form
            /subscriptions/{subId}/resourceGroups/{resourceGroupName}/providers/Microsoft.Web/sites/{siteName}
            for production slots and
            /subscriptions/{subId}/resourceGroups/{resourceGroupName}/providers/Microsoft.Web/sites/{siteName}/slots/{slotName}
            for other slots.

member.summary:
Gets or sets ARM resource ID of the source app. App resource ID is
of the form
/subscriptions/{subId}/resourceGroups/{resourceGroupName}/providers/Microsoft.Web/sites/{siteName}
for production slots and
/subscriptions/{subId}/resourceGroups/{resourceGroupName}/providers/Microsoft.Web/sites/{siteName}/slots/{slotName}
for other slots.

Gets or sets &lt;code&gt;true&lt;/code&gt; if the
local version is the latest version;
&lt;code&gt;false&lt;/code&gt; otherwise.

member.param:
ARM resource ID of the target app.
            /subscriptions/{subId}/resourceGroups/{resourceGroupName}/providers/Microsoft.Web/sites/{siteName}
            for production slots and
            /subscriptions/{subId}/resourceGroups/{resourceGroupName}/providers/Microsoft.Web/sites/{siteName}/slots/{slotName}
            for other slots.

member.summary:
Gets or sets ARM resource ID of the target app.
/subscriptions/{subId}/resourceGroups/{resourceGroupName}/providers/Microsoft.Web/sites/{siteName}
for production slots and
/subscriptions/{subId}/resourceGroups/{resourceGroupName}/providers/Microsoft.Web/sites/{siteName}/slots/{slotName}
for other slots.
